const _hoisted_6 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Lancer</li><li>True Name: Diarmuid Ua Duibhne</li><li>Gender: Male</li><li>Source: Celtic Mythology, Knights of Fianna</li><li>Origin: Ireland</li><li>Alignment: Lawful Neutral</li><li>Height: 184 cm</li><li>Weight: 85 kg</li></ul><p><strong>Meta</strong></p><ul><li>Scenario writer: Nasu Kinoko \xB7 Urobuchi Gen</li><li>Original character designer: Takeuchi Takashi</li><li>Character designer: Mata</li><li>CV: Midorikawa Hikaru</li><li>Major appearances: Fate/Zero</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">A+</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">E</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">B</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Magic Resistance: [B]</strong></p><p>Cancels spells with a chant below three verses.</p><p>Even being wounded by Greater Rituals and High-Thaumaturgy is difficult.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Eye of the Mind (True): [C]</strong></p><p>Perspective that has been cultivated through training and discipline.</p><p>Logic in battle to derive the possible means to survive in a predicament.</p><p><strong>Love\u2019s Beauty Spot: [C]</strong></p><p>Charms the opposite gender through a beauty spot tinged with mana. The opposing females will bear a strong love towards him.</p><p>Avoidance is possible with the Magic Resistance skill.</p><p><strong>Knight\u2019s Strategy: [B]</strong></p><p>A battle style that, regardless of power, induces a miss from the opponent while grasping the flow of battle. It\u2019s not self-strengthening, but a skill that invites the opponent to fail a check. A composed observation ability to wager victory in an instant. Specifically speaking, it generates a lot of critical stars.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="gae-dearg-crimson-rose-of-exorcism" tabindex="-1"><a class="header-anchor" href="#gae-dearg-crimson-rose-of-exorcism" aria-hidden="true">#</a> G\xE1e Dearg - Crimson rose of exorcism</h1><ul><li>Rank: B+</li><li>Type: Anti-Unit Noble Phantasm</li><li>Range: 2~4</li><li>Maximum number of targets: 1 person</li></ul><p>G\xE1e Dearg.</p><p>The crimson long spear. Negates magical effects of the target touched by the blade.</p><p>Basically, a Noble Phantasm that has the ability to nullify magecraft defense.</p><p>Steals the magical effects from defensive equipment braided with magecraft like Saber\u2019s armor, magecraft, or magecraft-like strengthening/skill boost by the Noble Phantasm \u300EA knight does not die with his hands empty\u300F, and reduces them to a state of only physical defense.</p><p>The object of negating mana isn\u2019t limited only to guards, but since it\u2019s displayed \u300Eonly the part touched by the blade\u300F and \u300Eonly the moment in which the blade is touching\u300F, it\u2019s not suitable for defensive usage. Also, it can\u2019t overthrow the effects of contracts or curses entwined in the past, as well as the effects of already completed magecraft. A spear that could be called a \u300ENoble Phantasm killer Noble Phantasm\u300F, but this effect of exorcism alone can\u2019t destroy Noble Phantasms. In the end, it negates the effects \u300Eonly the moment in which the blade is touching\u300F.</p><p>Against those who don\u2019t use magecraft, it\u2019s a simple spear, but it\u2019s unlikely not to use anything magical in a battle between fellow Servants, not flashy but a really useful Noble Phantasm.</p><h1 id="gae-buidhe-yellow-rose-of-mortality" tabindex="-1"><a class="header-anchor" href="#gae-buidhe-yellow-rose-of-mortality" aria-hidden="true">#</a> G\xE1e Buidhe - Yellow rose of mortality</h1><ul><li>Rank: B+</li><li>Type: Anti-Unit Noble Phantasm</li><li>Range: 2~3</li><li>Maximum number of targets: 1 person</li></ul><p>G\xE1e Buidhe.</p><p>The yellow short spear. Inflicts unhealable wounds. Impossible to dispel by normal means, wounds made by this spear won\u2019t heal as long the spear isn\u2019t destroyed or Diarmuid doesn\u2019t die.</p><p>The mechanism through which any treatment or regeneration can\u2019t be healed, is by making the damage dealt by the spear reduce the upper limit of the maximum HP. Therefore, even with treatment and regeneration, it won\u2019t be healed further from that because the \u300Ewounded state\u300F is the fully healed state.</p><p>Just a spear in decisive battles of brief duration, but thinking about the premise of fighting the same opponent multiple times over a long period of time, it\u2019s like a body blow that works slow yet certainly.</p><p>If the target isn\u2019t a Servant, a lethal effect like bleeding to death over time can be expected.</p><p>Same as \u300ECrimson rose of exorcism\u300F, it lacks flashiness, but it\u2019s an extremely easy to use Noble Phantasm. Incidentally, he who is the user won\u2019t be hurt by this spear. Used as a set with Crimson rose of exorcism in FateGO.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><ul><li>First person pronoun: \u4FFA (ore)</li><li>Second person pronoun: \u8CB4\u69D8 (kisama) / \u3007\u3007 (without honorifics)</li><li>Third person pronoun: \u8CB4\u69D8\u3089 (kisamara) / \u3007\u3007 (without honorifics)</li></ul><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>Fervently loyal, a Heroic Spirit-like Heroic Spirit that esteems honorable battles.</p><p>In life, he broke the affection he received and betrayed his lord, and because of that his lord let him die without helping him, but he doesn\u2019t regret his action of having chosen love over loyalty, nor grudges his lord for having let him die.</p><p>The story of his tragic love with the princess Gr\xE1inne, would later become the model for the story of Lancelot and Guinevere.</p><p>That nobility is hard to understand by others that aren\u2019t the same type of person as him, and as a result of him having swallowed even that mistake, cracks will be more spread\u2026\u2026</p><p>Despite having often met this kind of tragedies, his fundamentals never changed.</p><p>However, even for such a man, things have their limits. When confronting malice that doesn\u2019t think about others, while his heart is burned by feelings of resentment, he has also spewed anger, laments, and curses.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>There are no regrets in the conduct taken in life, or the destiny he chose.</p><p>However, if he\u2019s given a second life, that time he\u2019d choose and fight with loyalty\u2026\u2026</p><p>A person who participates in the Holy Grail War with that kind of feelings.</p><p>Servants have, contract apart,\u300Efreedom to want the Holy Grail\u300F, but in his case it\u2019s not that he wants the Holy Grail, but that he aims to \u300Eoffer the Holy Grail to his lord\u300F.</p><p>Thus, his conditions that are different from those of ordinary Servants, sometimes bring misunderstandings about his loyalty\u2026\u2026</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>\u300EWho must win now is Saber? Lancer? Neither of them. What should win here, is the \u300Cpath of the knight\u300D that we serve \u2015\u2015\u2015 Isn\u2019t that right? Heroic Spirit Artoria\u300F</p><p>\u300EMy dearest wish of victory, I entrust it to the blade of the King of Knights. I leave it to you, Saber\u300F</p><p>\u300EI won\u2019t kill my Master. I won\u2019t kill Saber\u2019s Master. She and I don\u2019t wish to end things like this. Never forget it. If you survive now at this place, it\u2019s for the nobility of the King of Knights\u300F</p><h2 id="historical-character-and-figure" tabindex="-1"><a class="header-anchor" href="#historical-character-and-figure" aria-hidden="true">#</a> Historical Character and Figure</h2><p>A prominent warrior of the Knights of Fianna led by the hero of ancient Ireland, Fionn mac Cumhaill.</p><p>Appears in the group of mythological stories about the Knights of Fianna called the Fenian cycle. He had two spears called G\xE1e Dearg and G\xE1e Buidhe, and two swords called Moralltach and Beagalltach, and in his graceful face there was a magical spot given by a fairy that charmed women.</p><p>This spot, invited to and brought calamity. Having captivated Fionn\u2019s fianc\xE9e Gr\xE1inne, he ended up eloping with her.</p><p>After wandering for several years, Diarmuid, who was allowed to return to the service of Fionn, who had finally calmed his anger, officially married Gr\xE1inne. But at one point, Diarmuid received a serious injury that left him moribund from a demonic boar while hunting. Diarmuid would have recovered if he had drank spring water scooped by Fionn\u2019s healing hands, but Fionn intentionally or casually spilled the water twice, and Diarmuid died.</p><h2 id="character-in-fgo" tabindex="-1"><a class="header-anchor" href="#character-in-fgo" aria-hidden="true">#</a> Character in FGO</h2><p>In chapter 5 \u300ENorth America Great War of Myths\u300F, he appears in combination with who once was his lord, Fionn mac Cumhaill.</p><p>They serve as the Celtic faction\u2019s advance-guard, but the delicate situation in which he receives sarcasm from Fionn with every little thing, no matter if he\u2019s aware or not, perplexes the protagonist side. A master-servant relation with an odd tempo, but they were compatriots that matched their breathing.</p><h2 id="role-in-past-works" tabindex="-1"><a class="header-anchor" href="#role-in-past-works" aria-hidden="true">#</a> Role in past works:</h2><p>In \u300EFate/Zero\u300F, appears as the Servant of the prestigious mage Kayneth El-Melloi Archibald.<br> Perhaps a mischief of destiny, his Master\u2019s fianc\xE9e Sola-Ui Nuada-Re Sophia-Ri becomes charmed by his magical spot, and as in the past, he ends up in the same composition of discord with the lord that ends up taking his life.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Fionn mac Cumhaill</strong></p><p>Appear together as a knight\u2019s Heroic Spirit, and fight together. Nothing can make him happier\u2026\u2026!</p><p>Most importantly, Fionn-dono at his golden age is good! \u2026\u2026 Well, those strange jokes at his golden age are troubling\u2026\u2026</p><p><strong>C\xFA Chulainn</strong></p><p>Respects him as a great pioneer, and as a supreme spearman. But, isn\u2019t that teacher too Spartan?</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>Diarmuid was my favorite Servant since Zero so I was happy to draw him! But at the same time, I never regretted so much to be bad at drawing muscles. I went through Hell. I\u2019m sorry. The clothing at the Ascension 3 Stage is very cool. This was suggested by Takeuchi-sensei. Knight clothing style. A ladykiller. (Mata)</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-296.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-297.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-298.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-299.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-300.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-301.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-302.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-II/i-303.jpg?raw=true" alt=""></p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 86);
